staticBinding.value:
echo "IPADDR=${IPAddress}" >> /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
echo "NETMASK=${Netmask}" >> /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
echo "DNS1=${DNS1}" >> /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
echo "DNS2=${DNS2}" >> /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
sed -i 's/BOOTPROTO=dhcp/BOOTPROTO=static/gi' /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
sed -i 's/DEFROUTE=yes/DEFROUTE=no/gi' /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
sed -i 's/ONBOOT=no/ONBOOT=yes/gi' /etc/sysconfig/network-scripts/ifcfg-${InterfaceName}
